window.bookSummaryJSON = "<p><i>Oracle</i> is a psychological thriller audiobook following Nate Russo, an FBI psychic who helps solve abductions and homicides by touching those close to the missing persons. His unique gift comes with a terrible price: He sees the horrific moments before the victims disappeared. This high-stakes mystery, written by best-selling author Andrew Pyper and performed by Joshua Jackson, combines crime investigations with supernatural elements and killer instincts.</p>"; 
